  false,\n\t\"url\": null,\n\t\"notes\": \"Samples of sediment, rangia clams (Rangia
  cuneata), gizzard shad (Dorosoma cepedianum), and longnose gar (Lepisosteus osseus)
  were collected from five sites in the lower Pamlico River and analyzed for elemental
  contaminants, organochlorines, aliphatic hydrocarbons, and polynuclear aromatic
  hydrocarbons. Most sample concentrations were either beneath the detection limit
  or too low to be associated with biological impacts. However, sediment sample concentrations
  of cadmium and fluoride were observed at levels that could be associated with biological
  impacts at one of the sites which was located near the discharge from a large phosphate
  mining operation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
